import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';

const UpdateMovie = () => {
    const navigate = useNavigate();
    const { id } = useParams(); // Get movie ID from URL
    const [title, setTitle] = useState('');
    const [director, setDirector] = useState('');
    const [year, setYear] = useState('');
    const [image, setImage] = useState(null);
    const [imageURL, setImageURL] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchMovie = async () => {
            try {
                const token = localStorage.getItem('token');
                if (!token) {
                    setError('No token found. Please log in.');
                    console.log('No token found. Please log in.');
                    return;
                }

                const response = await axios.get(`http://localhost:8081/api/movie/${id}`, {
                    headers: { Authorization: `Bearer ${token}` },
                });

                const { title, director, year, image } = response.data;
                setTitle(title);
                setDirector(director);
                setYear(year);
                setImageURL(image); // Assuming image is a URL
                console.log('Fetched movie data:', response.data);
            } catch (error) {
                console.error('Error fetching movie data:', error);
                setError('Error fetching movie data');
            }
        };

        fetchMovie();
    }, [id]);

    const verifyToken = () => {
        const token = localStorage.getItem('token');
        if (!token) {
            setError('No token found. Please log in.');
            console.log('No token found. Please log in.');
            return null;
        }
        console.log('Token verified:', token);
        return token;
    };

    const uploadImage = useCallback(async () => {
        if (image) {
            const formData = new FormData();
            formData.append('image', image);

            const token = verifyToken();
            if (!token) return;

            try {
                const response = await axios.post('http://localhost:8081/api/upload', formData, {
                    headers: { Authorization: `Bearer ${token}` },
                });
                setImageURL(response.data);
                console.log('Image uploaded:', response.data);
            } catch (error) {
                console.log('Error uploading image:', error);
                setError('Error uploading image');
            }
        }
    }, [image]);

    const handleImageChange = (e) => {
        setImage(e.target.files[0]);
    };

    useEffect(() => {
        uploadImage();
    }, [uploadImage]);

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            if (!title || !director || !year || !imageURL) {
                setError('Please fill out all fields.');
                return;
            }

            const token = verifyToken();
            if (!token) return;

            const movieData = { title, director, year, image: imageURL };
            console.log('Movie data:', movieData);

            // Update movie
            await axios.put(`http://localhost:8081/api/movie`, movieData, {
                headers: { Authorization: `Bearer ${token}` },
            });

            navigate('/movies');
        } catch (error) {
            console.log('Error updating movie:', error);
            if (error.response) {
                setError(error.response.data.message);
            } else if (error.request) {
                setError('No response received from server');
            } else {
                setError('Error updating movie: ' + error.message);
            }
        }
    };

    return (
        <div className="update-movie-container">
            <h2>Update Movie</h2>
            <form onSubmit={handleSubmit}>
                <label>Title:</label>
                <input
                    type="text"
                    value={title}
                    onChange={(e) => setTitle(e.target.value)}
                    required
                />

                <label>Director:</label>
                <input
                    type="text"
                    value={director}
                    onChange={(e) => setDirector(e.target.value)}
                    required
                />

                <label>Year:</label>
                <input
                    type="number"
                    value={year}
                    onChange={(e) => setYear(e.target.value)}
                    required
                />

                <label>Image:</label>
                <input
                    type="file"
                    onChange={handleImageChange}
                    accept="image/*"
                />

                {error && <div className="error-message">{error}</div>}

                <button type="submit">Update Movie</button>
            </form>
        </div>
    );
};

export default UpdateMovie;
